var x=document.getElementById('login');
var y=document.getElementById('reg');
var bt=document.getElementById('btn');
function Register()
{
    x.style.left="-400px";
    y.style.left="50px";
    bt.style.left="100px";
}
function login()
{
    x.style.left="50px";
    y.style.left="450px";
    bt.style.left="0";
}
